import NavBar from "../components/NavBar";
import { Link } from "react-router-dom";
//BOOTSTRAP
import { Container, Row, Col, Button } from "react-bootstrap";
const ShipBuilder = () => {
  return (
    <Container>
      <NavBar />
      <Row className="justify-content-center">
        <Col>
          <form></form>
        </Col>
      </Row>
    </Container>
  );
};
export default ShipBuilder;
